    false,nt"url": null,nt"notes": "This report provides general information
    about Malheur Lake. Malheur Lake is one of the largest inland marshes in the United
    States and has the added distinction of being essentially in a natural condition.
    It is one of the most important sections of the Malheur National Wildlife Refuge
    and comprises about one-third of the total refuge acreage of 181,000 acres. Malheur
    Lake is really a marsh. When water levels are at a maximum, it covers approximately
    50,000 acres and is about 20 miles long by 12 miles wide. The great biological productivity
    of the lake region, especially the size and diversity of its bird fauna, has impressed
    amateur and professional naturalists from the late 1800's to the present. Although
    Malheur Lake is one of the outstanding aquatic habitats in the western United States,
    details of its ecology are known to only a few.",nt"license_title": "License
